import Languages from '@/i18n/locale';
import { mapState, mapActions } from 'vuex';

export default {
    name: 'iHeaderI18n',
    data () {
        return {
            languages: Languages
        }
    },
    computed: {
        ...mapState('admin/i18n', [
            'locale'
        ]),
        ...mapState('admin/layout', [
            'isMobile'
        ])
    },
    methods: {
        ...mapActions('admin/i18n', [
            'setLocale'
        ]),
        handleClick (locale) {
            if (locale === this.locale) return;
            this.setLocale({ locale, vm: this });
        }
    }
}
